import React from 'react';
import '../../assets/css/App.css';

const Dialog = props => {

    return (
        <FancyBorder color="blue">
            <h1 className="Dialog-title">
                {props.title}
            </h1>
            <p>
                {props.message}
            </p>
            {props.children} 
        </FancyBorder>
    );
}
const FancyBorder = props => (
    <div>
        {props.children}
    </div>
);

export default Dialog;
